defmodule Cesr.CesrTest do
  alias Cesr
  alias Cesr.CesrElement
  alias Cesr.CodeTable
  alias Cesr.CodeTable.KeriIndexCodeTable
  alias Cesr.CountCodeKERIv1
  alias Cesr.CountCodeKERIv2
  alias Cesr.Primitive
  alias Cesr.Version_String_1
  alias Cesr.Version_String_2

  import ExUnit.CaptureLog

  use ExUnit.Case, async: true
  doctest Cesr

  test "Cold start simplest element works" do
    assert Cesr.consume_stream("-_AAABAA") == [:keri_aaabaa]
    assert Cesr.consume_stream("-_AAACAA") == [:keri_aaacaa]
    assert Cesr.consume_stream("-_______") == {:error, "Unknown protocol/genus in stream"}
    assert Cesr.consume_stream(<<251, 240, 0, 0, 16, 0>>) == [:keri_aaabaa]
    assert Cesr.consume_stream(<<251, 240, 0, 0, 32, 0>>) == [:keri_aaacaa]
    assert Cesr.consume_stream(<<251, 240, 0, 0, 32, 0>>) == [:keri_aaacaa]
    assert Cesr.consume_stream(<<251, 255, 255, 255, 255, 255>>) == {:error, "Unknown protocol/genus in stream"}
  end

  test "Consume Primitive T works simple" do
    # without version (ver2 default)
    consumed = Cesr.consume_primitive_T("DFH4NM-OWtz0QVwB32CDf2ksq3eLATa1IT1LUywWwpTZ")
    assert consumed == {:ok,
      %Primitive.CD_D_Ed25519{
        code: "D",
        payload: <<81, 248, 52, 207, 142, 90, 220, 244, 65, 92, 1, 223, 96, 131, 127,
          105, 44, 171, 119, 139, 1, 54, 181, 33, 61, 75, 83, 44, 22, 194, 148, 217>>
      }}

    # same as ver2 explicit
    {:ok, ver2} = Version_String_2.new(%{proto: :keri, proto_major: 1,
      proto_minor: 0, genus_major: 1, genus_minor: 0, kind: :json, size: 0})
    assert Cesr.consume_primitive_T("DFH4NM-OWtz0QVwB32CDf2ksq3eLATa1IT1LUywWwpTZ", ver2) == consumed

    # same as ver1 but only because primitives don't change
    {:ok, ver1} = Version_String_1.new(%{proto: :keri, major: 1, minor: 0, kind: :json, size: 0})
    assert Cesr.consume_primitive_T("DFH4NM-OWtz0QVwB32CDf2ksq3eLATa1IT1LUywWwpTZ", ver1) == consumed
  end

  test "Consume Stream Parses" do
    # Count Code -V containing simplest CESR Primitive (1AAM_True)
    {:ok, true_primitive} = Primitive.CD_1AAM_Yes.new(<<>>)
    {:ok, simplest_a_cnt_code_struct} =
        Cesr.CountCodeKERIv1.CD_dashV_BigAttachmentGroup.new([true_primitive])
    binary_rep = CesrElement.to_binary(simplest_a_cnt_code_struct)
    qb64_rep = CesrElement.to_b64(simplest_a_cnt_code_struct)
    # Consume it as a cesr stream
    assert Cesr.consume_stream(binary_rep) == [simplest_a_cnt_code_struct]
    assert Cesr.consume_stream(qb64_rep) == [simplest_a_cnt_code_struct]
  end

  # Note: The examples all use \t, \n, \r because those are the only way to
  # denote a comment in CESR.  Its hidden in a comment in the CESR spec to
  # 
  # quote:
  #
  # Finally, several useful applications of ‘T’ domain encoding of CESR streams
  # for archiving or logging may benefit from annotations. The white space
  # ASCII characters for line feed, carriage return, and tab all have starting
  # tritets of 0b000.
  # So only \t, \n, \r (or the other ASCII characters that happent to start with 0b000 I guess)
  # You could put some beeps in there if you want probably.
  #
  # There's a known bug in our implementation here and in keripy in which field
  # maps (cbor, json, mgpk) containing these characters would have them
  # stripped in the naive implementation.  That's a submarine scientist for you
  # though...
 
  test "Consume (Text) Stream Parses with annotations (whitespace) in stream" do
    # Count Code dashV containing simplest CESR Primitive (1AAM_True)
    {:ok, true_primitive} = Cesr.Primitive.CD_1AAM_Yes.new(<<>>)
    {:ok, simplest_a_cnt_code_struct} =
        Cesr.CountCodeKERIv1.CD_dashV_BigAttachmentGroup.new([true_primitive])

    qb64_rep = Cesr.CesrElement.to_b64(simplest_a_cnt_code_struct)
    # Consume it as a cesr stream
    assert Cesr.consume_stream(qb64_rep <> "\n") == [simplest_a_cnt_code_struct]
    assert Cesr.consume_stream(qb64_rep <> "\r") == [simplest_a_cnt_code_struct]
    assert Cesr.consume_stream(qb64_rep <> "\n\r") == [simplest_a_cnt_code_struct]
    assert Cesr.consume_stream(qb64_rep <> "\t# some comment \n") == [simplest_a_cnt_code_struct]
    assert Cesr.consume_stream(qb64_rep <> "\t# some comment \n\r") == [simplest_a_cnt_code_struct]
    assert Cesr.consume_stream(qb64_rep <> "\t# some comment \r") == [simplest_a_cnt_code_struct]
  end

  test "Consume element fails" do
    {result, log} = with_log(fn -> Cesr.consume_element("") end)
    assert result == {:error, "Not enough bytes in cesr element"}
    assert log =~ "[warning] Not enough bytes in cesr element"

    {result2, log2} = with_log(fn -> Cesr.consume_element("-") end)
    assert result2 == {:error, "Not enough bytes in cesr element"}
    assert log2 =~ "[warning] Not enough bytes in stream: -"

    {result3, log3} = with_log(fn -> Cesr.consume_element("-A") end)
    assert result3 == {:error, "Not enough bytes in cesr element"}
    assert log3 =~ "[warning] Not enough bytes in stream: -A"
  end

  test "Json consumed on element works" do
    assert Cesr.consume_element("{\"v\":\"KERIBAABAAJSONAABB.\",\"foo\":{\"bar\":\"baz\"},\"wibble\":\"wobble\"}")
      == {:ok, %OrdMap{tuples: [{"v", %Version_String_2{proto_major: 1, proto_minor: 0, genus_major: 1, genus_minor: 0, size: 65, kind: :json, proto: :keri}}, 
                                {"foo", %OrdMap{tuples: [{"bar", "baz"}]}}, {"wibble", "wobble"}]}, ""}
  end

  test "Json consumed on element fails" do
    # Missing last bracket
    assert Cesr.consume_element("{\"v\":\"KERIBAABAAJSONAABB.\",\"foo\":{\"bar\":\"baz\"},\"wibble\":\"wobble\"")
      == {:error, "Not enough input to read version string"}

    # Empty version string
    assert Cesr.consume_element("{\"v\":\"\",\"foo\":{\"bar\":\"baz\"},\"wibble\":\"wobble\"}")
      == {:error, "Error in processing json map: No version matched {\"v\":\"\",\"foo\":{\"bar\":\"baz"}

    # Version string at end
    assert Cesr.consume_element("{\"foo\":{\"bar\":\"baz\"},\"wibble\":\"wobble\",\"v\":\"KERIBAAJSONAAA-.\"")
      == {:error, "Error in processing json map: No version matched {\"foo\":{\"bar\":\"baz\"},\"wib"}
  end

  test "Message Pack consumed on element succeeds" do
    # EASY EXAMPLE
    out = :msgpack.pack([{"v", "KERIBAABAAMGPKAAAj."}, {"foo", "bar"}], [map_format: :jsx])
    {:ok, value, ""} = Cesr.consume_element(out)
    assert value == %OrdMap{tuples: [{"v", %Version_String_2{proto_major: 1, proto_minor: 0, genus_major: 1, genus_minor: 0, size: 35, kind: :mgpk, proto: :keri}}, {"foo", "bar"}]}
    assert value["v"] == %Version_String_2{proto_major: 1, proto_minor: 0, genus_major: 1, genus_minor: 0, size: 35, kind: :mgpk, proto: :keri}
    assert value["foo"] == "bar"

    # Multi-level EXAMPLE
    out = :msgpack.pack([{"v", "KERIBAABAAMGPKAAAp."}, {"foo", [{"bar", "baz"}]}], [map_format: :jsx])
    {:ok, value, ""} = Cesr.consume_element(out)
    version_string = %Version_String_2{proto_major: 1, proto_minor: 0,
      genus_major: 1, genus_minor: 0, size: 41, kind: :mgpk, proto: :keri}
    assert value == %OrdMap{tuples: [{"v", version_string}, {"foo", %OrdMap{tuples: [{"bar", "baz"}]}}]}
    assert value["v"] == version_string 
    assert value["foo"] == %OrdMap{tuples: [{"bar", "baz"}]}
  end

  # needs to be OrdMap instead of Map
  test "Bad Message Pack consumed on element fails" do
    # Size wrong
    out = :msgpack.pack([{"v", "KERIBAABAAMGPKAAAA."}, {"foo", "bar"}], [map_format: :jsx])
    assert Cesr.consume_element(out) == {:error, "Error in processing mgpk fixmap: Error in MsgPack decoding: incomplete"}

    # Wrong proto
    out = :msgpack.pack([{"v", "ZZZZBAAMGPKAAAg."}, {"foo", "bar"}], [map_format: :jsx])
    assert Cesr.consume_element(out) == {:error, "Error in processing mgpk fixmap: No version matched \x82\xC4\x01v\xC4\x10ZZZZBAAMGPKAAAg.\xC4\x03f"}

    # Wrong version
    out = :msgpack.pack([{"v", "KERI***MGPKAAAg."}, {"foo", "bar"}], [map_format: :jsx])
    assert Cesr.consume_element(out) == {:error, "Error in processing mgpk fixmap: No version matched \x82\xC4\x01v\xC4\x10KERI***MGPKAAAg.\xC4\x03f"}
  end

  test "CBOR consumed element succeeds" do
    # EASY EXAMPLE
    out = CBOR.encode(%OrdMap{tuples: [{"v", "KERIBAABAACBORAAAf."}, {"foo", "bar"}]})
    {:ok, value, ""} = Cesr.consume_element(out)
    version_string = %Version_String_2{proto_major: 1, proto_minor:
      0, genus_major: 1, genus_minor: 0, size: 31, kind: :cbor, proto: :keri}
    assert value == %OrdMap{tuples: [{"v", version_string}, {"foo", "bar"}]}
    assert value["v"] == version_string
    assert value["foo"] == "bar"

    # Multi-level EXAMPLE
    out = CBOR.encode(%OrdMap{tuples: [{"v", "KERIBAABAACBORAAAk."}, {"foo", %OrdMap{tuples: [{"bar", "baz"}]}}]})
    {:ok, value, ""} = Cesr.consume_element(out)
    version_string = %Version_String_2{proto_major: 1, proto_minor: 0, genus_major: 1, genus_minor: 0, size: 36, kind: :cbor, proto: :keri}
    assert value == %OrdMap{tuples: [{"v", version_string}, {"foo", %OrdMap{tuples: [{"bar", "baz"}]}}]}
    assert value["v"] == version_string
    assert value["foo"] == %OrdMap{tuples: [{"bar", "baz"}]}

    # Taken from keri/core/test_eventing.py
    line_414 = "\xadavqKERI10CBOR0000f9_atcicpadx,EDTOWE_oHAO7j6rhUMGfQ_kX8GJbpaAhO-luqqsp5mK-aix,EDTOWE_oHAO7j6rhUMGfQ_kX8GJbpaAhO-luqqsp5mK-asa0bkta1ak\x81x,DC8kCMHKrYZewclvG9vj1R1nSspiRwPi-ByqRwFuyq4ibnta1an\x81x,EBPlMwLJ5rSKWCaZq4bczEHLQvYX3P7cILmBzy0Pp4O4bbta0ab\x80ac\x80aa\x80"
    {:ok, value, ""} = Cesr.consume_element(line_414)
    assert value == %OrdMap{tuples: [{"v", %Version_String_1{proto:
      :keri, major: 1, minor: 0, kind: :cbor, size: 249}}, {"t", "icp"}, {"d",
        "EDTOWE_oHAO7j6rhUMGfQ_kX8GJbpaAhO-luqqsp5mK-"}, {"i",
          "EDTOWE_oHAO7j6rhUMGfQ_kX8GJbpaAhO-luqqsp5mK-"}, {"s", "0"}, {"kt",
            "1"}, {"k", ["DC8kCMHKrYZewclvG9vj1R1nSspiRwPi-ByqRwFuyq4i"]},
      {"nt", "1"}, {"n", ["EBPlMwLJ5rSKWCaZq4bczEHLQvYX3P7cILmBzy0Pp4O4"]},
      {"bt", "0"}, {"b", []}, {"c", []}, {"a", []}]}
  end

  test "CBOR consumed element fails" do
    # Size wrong
    out = CBOR.encode(%OrdMap{tuples: [{"v", "KERIBAABAACBORAAAA."}, {"foo", "bar"}]})
    assert Cesr.consume_element(out) == {:error, "Error in processing CBOR map: Error in CBOR decoding: cbor_function_clause_error"}

    # Wrong proto
    out = CBOR.encode(%OrdMap{tuples: [{"v", "ZZZZBAABAACBORAAAg."}, {"foo", "bar"}]})
    assert Cesr.consume_element(out) == {:error, "Error in processing CBOR map: No version matched \xA2avsZZZZBAABAACBORAAAg.cf"}

    # Wrong version
    out = CBOR.encode(%OrdMap{tuples: [{"v", "KERI******CBORAAAg."}, {"foo", "bar"}]})
    assert Cesr.consume_element(out) == {:error, "Error in processing CBOR map: No version matched \xA2avsKERI******CBORAAAg.cf"}
  end

  test "CesrStringB64 Primitive Test" do
    # Took this from keripy
    # raw:    b'\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5'
    # code:   4A
    # soft:   AK
    # qb2:    b'\xe0\x00\n\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5'
    # l(qb2): 33
    # qb64:   4AAKA1s3k1s2v1s2v1s2c1s2c1s2k1v1a1s2c1s2k1v1
    # l(qb64):        44

    {:ok, cesr_str_inst} = Cesr.Primitive.CesrStringB64.new("\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5", "4A")
    # assert four_a_inst.code == "4A"
    # assert four_a_inst.soft_size == 10
    # assert four_a_inst.raw == "\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5"
    # assert Base.url_decode64(four_a_inst.raw)
    assert Cesr.Primitive.CesrStringB64.to_b64(cesr_str_inst) == "4AAKA1s3k1s2v1s2v1s2c1s2c1s2k1v1a1s2c1s2k1v1"
    assert Cesr.Primitive.CesrStringB64.to_binary(cesr_str_inst) == "\xe0\x00\n\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5"
    assert Cesr.Primitive.CesrStringB64.from_b64("4AAKA1s3k1s2v1s2v1s2c1s2c1s2k1v1a1s2c1s2k1v1") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.Primitive.CesrStringB64.from_binary("\xe0\x00\n\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV1.get_T("4AAKA1s3k1s2v1s2v1s2c1s2c1s2k1v1a1s2c1s2k1v1") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV2.get_T("4AAKA1s3k1s2v1s2v1s2c1s2c1s2k1v1a1s2c1s2k1v1") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV1.get_B("\xe0\x00\n\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV2.get_B("\xe0\x00\n\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5") == {{:ok, cesr_str_inst}, ""}

    # raw:    b'>'
    # code:   6A
    # soft:   AB
    # qb2:    b'\xe8\x00\x01\x00\x00>'
    # l(qb2): 6
    # qb64:   6AABAAA-
    # l(64):  8

    # Note: in the cesr-test-vectors repo you'll find that this test vector has the value "\x3e" as opposed to the zero padded value below.
    # This is because of a bullshit requirement that "may or may not" (see Bexter object doc in keripy) remove leading zeros
    # For this test we're going to make everything fully padded so that our tests pass and deal with this at a higher layer.
    {:ok, cesr_str_inst} = Cesr.Primitive.CesrStringB64.new("\x3e", "6A")
    # assert four_a_inst.code == "4A"
    # assert four_a_inst.soft_size == 10
    # assert four_a_inst.raw == "\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5"
    # assert Base.url_decode64(four_a_inst.raw)
    # TEXT
    # 6      A      A      B      A      A      A      -
    # 111010 000000 000000 000001 000000 000000 000000 111110
    # BINARY
    # \xe  8    0    0    0    1    0    0    0    0    3    e
    # 1110 1000 0000 0000 0000 0001 0000 0000 0000 0000 0011 1110
    # (code         )(count        )                    (payload )
    # RAW
    # \x3e
    # 0011 1110
    assert Cesr.Primitive.CesrStringB64.to_b64(cesr_str_inst) == "6AABAAA-"
    assert Cesr.Primitive.CesrStringB64.to_binary(cesr_str_inst) == "\xe8\x00\x01\x00\x00>"
    # assert Cesr.Primitive.CesrStringB64.from_b64("6AABAAA-") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.Primitive.CesrStringB64.from_binary("\xe8\x00\x01\x00\x00>") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV1.get_T("6AABAAA-") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV2.get_T("6AABAAA-") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV1.get_B("\xe8\x00\x01\x00\x00>") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV2.get_B("\xe8\x00\x01\x00\x00>") == {{:ok, cesr_str_inst}, ""}

    # raw:    b'\x0f\x9e\xfa,g'
    # code:   5A
    # soft:   AC
    # qb2:    b'\xe4\x00\x02\x00\x0f\x9e\xfa,g'
    # l(qb2): 9
    # qb64:   5AACAA-e-ixn
    # l(64):  12
    {:ok, cesr_str_inst} = Cesr.Primitive.CesrStringB64.new("\x0f\x9e\xfa,g", "5A")
    # assert four_a_inst.code == "4A"
    # assert four_a_inst.soft_size == 10
    # assert four_a_inst.raw == "\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5"
    # assert Base.url_decode64(four_a_inst.raw)
    assert Cesr.Primitive.CesrStringB64.to_b64(cesr_str_inst) == "5AACAA-e-ixn"
    assert Cesr.Primitive.CesrStringB64.to_binary(cesr_str_inst) == "\xe4\x00\x02\x00\x0f\x9e\xfa,g"
    assert Cesr.Primitive.CesrStringB64.from_b64("5AACAA-e-ixn") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.Primitive.CesrStringB64.from_binary("\xe4\x00\x02\x00\x0f\x9e\xfa,g") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV1.get_T("5AACAA-e-ixn") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV2.get_T("5AACAA-e-ixn") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV1.get_B("\xe4\x00\x02\x00\x0f\x9e\xfa,g") == {{:ok, cesr_str_inst}, ""}
    assert Cesr.CodeTable.KeriCodeTableV2.get_B("\xe4\x00\x02\x00\x0f\x9e\xfa,g") == {{:ok, cesr_str_inst}, ""}

    # SAME EXAMPLES BUT WITH BIG CODES
    {:ok, cesr_str_inst} = Cesr.Primitive.CesrStringB64.new("\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5", "7AAA")
    assert Primitive.CesrStringB64.to_b64(cesr_str_inst) == "7AAAAAAKA1s3k1s2v1s2v1s2c1s2c1s2k1v1a1s2c1s2k1v1"
    assert Primitive.CesrStringB64.to_binary(cesr_str_inst) == "\xEC\0\0\0\0\n\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5"
    assert Primitive.CesrStringB64.from_b64("7AAAAAAKA1s3k1s2v1s2v1s2c1s2c1s2k1v1a1s2c1s2k1v1") == {{:ok, cesr_str_inst}, ""}
    assert Primitive.CesrStringB64.from_binary("\xEC\0\0\0\0\n\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5") == {{:ok, cesr_str_inst}, ""}
    assert CodeTable.KeriCodeTableV1.get_T("7AAAAAAKA1s3k1s2v1s2v1s2c1s2c1s2k1v1a1s2c1s2k1v1") == {{:ok, cesr_str_inst}, ""}
    assert CodeTable.KeriCodeTableV2.get_T("7AAAAAAKA1s3k1s2v1s2v1s2c1s2c1s2k1v1a1s2c1s2k1v1") == {{:ok, cesr_str_inst}, ""}
    assert CodeTable.KeriCodeTableV1.get_B("\xEC\0\0\0\0\n\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5") == {{:ok, cesr_str_inst}, ""}
    assert CodeTable.KeriCodeTableV2.get_B("\xEC\0\0\0\0\n\x03[7\x93[6\xbf[6\xbf[6s[6s[6\x93[\xf5k[6s[6\x93[\xf5") == {{:ok, cesr_str_inst}, ""}

    {:ok, cesr_str_inst} = Cesr.Primitive.CesrStringB64.new("\x3e", "9AAA")
    assert Primitive.CesrStringB64.to_b64(cesr_str_inst) == "9AAAAAABAAA-"
    assert Primitive.CesrStringB64.to_binary(cesr_str_inst) == "\xf4\0\0\0\x00\x01\x00\x00>"
    assert Primitive.CesrStringB64.from_b64("9AAAAAABAAA-") == {{:ok, cesr_str_inst}, ""}
    assert Primitive.CesrStringB64.from_binary("\xf4\0\0\0\x00\x01\x00\x00>") == {{:ok, cesr_str_inst}, ""}
    assert CodeTable.KeriCodeTableV1.get_T("9AAAAAABAAA-") == {{:ok, cesr_str_inst}, ""}
    assert CodeTable.KeriCodeTableV2.get_T("9AAAAAABAAA-") == {{:ok, cesr_str_inst}, ""}
    assert CodeTable.KeriCodeTableV1.get_B("\xf4\0\0\0\x00\x01\x00\x00>") == {{:ok, cesr_str_inst}, ""}
    assert CodeTable.KeriCodeTableV2.get_B("\xf4\0\0\0\x00\x01\x00\x00>") == {{:ok, cesr_str_inst}, ""}

