    # Empty
    simplest_a_cnt_code = "-AAA"
    {:ok, simplest_a_cnt_code_b} = Base.url_decode64("-AAA")
    {:ok, simplest_a_cnt_code_struct} = Cesr.CountCodeKERIv1.CD_A_ControllerIdxSigs.new([])
    assert CodeTable.KeriCodeTableV1.get_T(simplest_a_cnt_code) == {{:ok, %Cesr.CountCodeKERIv1.CD_A_ControllerIdxSigs{cesr_elements: []}}, ""}
    assert Cesr.CountCodeKERIv1.CD_A_ControllerIdxSigs.from_b64(simplest_a_cnt_code) == {{:ok, %Cesr.CountCodeKERIv1.CD_A_ControllerIdxSigs{cesr_elements: []}}, ""}
    assert simplest_a_cnt_code_struct == %Cesr.CountCodeKERIv1.CD_A_ControllerIdxSigs{cesr_elements: []}
    assert CountCodeKERIv1.CD_A_ControllerIdxSigs.to_b64(simplest_a_cnt_code_struct) == simplest_a_cnt_code
    assert CountCodeKERIv1.CD_A_ControllerIdxSigs.from_binary(simplest_a_cnt_code_b) == {{:ok, %Cesr.CountCodeKERIv1.CD_A_ControllerIdxSigs{cesr_elements: []}}, ""}
    assert CountCodeKERIv1.CD_A_ControllerIdxSigs.to_binary(simplest_a_cnt_code_struct) == simplest_a_cnt_code_b

    # One CESR Primitive
    simplest_a_cnt_code = "-AABABBC4Q0Yh2qk9Bv2-A_XxUI6MlLZG6o9CN7ePE8nB1GSc-htqujynx7QtM2wbCwpspyp6XhrszVnDFn7w1TfxHcO"
    {:ok, simplest_a_cnt_code_b} = Base.url_decode64("-AABABBC4Q0Yh2qk9Bv2-A_XxUI6MlLZG6o9CN7ePE8nB1GSc-htqujynx7QtM2wbCwpspyp6XhrszVnDFn7w1TfxHcO")
    {{:ok, a_idx_cd}, _} = Primitive.Indexes.IDX_A_Ed25519_Sig.from_b64("ABBC4Q0Yh2qk9Bv2-A_XxUI6MlLZG6o9CN7ePE8nB1GSc-htqujynx7QtM2wbCwpspyp6XhrszVnDFn7w1TfxHcO")
    {:ok, simplest_a_cnt_code_struct} = CountCodeKERIv1.CD_A_ControllerIdxSigs.new([a_idx_cd])
    assert CodeTable.KeriCodeTableV1.get_T(simplest_a_cnt_code) == {{:ok, simplest_a_cnt_code_struct}, ""}
    assert CountCodeKERIv1.CD_A_ControllerIdxSigs.from_b64(simplest_a_cnt_code) == {{:ok, simplest_a_cnt_code_struct}, ""}
    assert simplest_a_cnt_code_struct == simplest_a_cnt_code_struct
    assert CountCodeKERIv1.CD_A_ControllerIdxSigs.to_b64(simplest_a_cnt_code_struct) == simplest_a_cnt_code
    # Note: The reason the below is commented out and the error test is
    # checked is because we're interpreting the semantics of the V1
    # count codes as to only contain B64 elements, so decoding it in a
    # binary context we don't support.
    # This is a guess on our part as the keripy codebase and the spec aren't clear on the matter
    # because the "advanced professor of logic" 😉 thinks that these count code semantics
    # are out of scope.
    #assert CountCodeKERIv1.CD_A_ControllerIdxSigs.from_binary(simplest_a_cnt_code_b) == {{:ok, simplest_a_cnt_code_struct}, ""}
    assert CountCodeKERIv1.CD_A_ControllerIdxSigs.from_binary(simplest_a_cnt_code_b) == {:error, "This count code can't support binary elements"}
    assert CountCodeKERIv1.CD_A_ControllerIdxSigs.to_binary(simplest_a_cnt_code_struct) == simplest_a_cnt_code_b
  end

  test "Count Code C test (CESR v1)" do
    # Wrong kind of elements
    count_code_wrong = "-CAB1AAM1AAM"
    assert match?({:error, _}, CountCodeKERIv1.CD_C_NonTransReceiptCouples.from_b64(count_code_wrong)) 
    {:ok, true_primitive} = Primitive.CD_1AAM_Yes.new(<<>>)
    {:error, "&Cesr.CountCodeKERIv1.CountCodeValidationUtilities.is_pre_sig?/1 returned false!"} = CountCodeKERIv1.CD_C_NonTransReceiptCouples.new([true_primitive, true_primitive])

    # Not enough elements
    fake_ed25519_b64 = "B" <> String.duplicate("A", 43)
    {:ok, fake_ed25519} = Cesr.consume_primitive_T(fake_ed25519_b64)
    c_count_code_not_enough = "-CAB" <> fake_ed25519_b64
    assert CountCodeKERIv1.CD_C_NonTransReceiptCouples.from_b64(c_count_code_not_enough) == {:error, "count code not found"}
    {:error, _} = CountCodeKERIv1.CD_C_NonTransReceiptCouples.new([fake_ed25519])

    # Happy path
    fake_ed25519_sig_b64 = "0B" <> String.duplicate("A", 86)
    {:ok, fake_ed25519_sig} = Cesr.consume_primitive_T(fake_ed25519_sig_b64)
    good_c_count_code_b64 = c_count_code_not_enough <> fake_ed25519_sig_b64
    {{:ok, good_c_count_code}, ""} = CountCodeKERIv1.CD_C_NonTransReceiptCouples.from_b64(good_c_count_code_b64)
    assert good_c_count_code == %CountCodeKERIv1.CD_C_NonTransReceiptCouples{cesr_elements: [fake_ed25519, fake_ed25519_sig]}

    # Binary not supported
    {:ok, good_c_count_code_b} = Base.url_decode64(good_c_count_code_b64)
    assert CountCodeKERIv1.CD_C_NonTransReceiptCouples.from_binary(good_c_count_code_b) == {:error, "This count code can't support binary elements"}

    assert CodeTable.KeriCodeTableV1.get_T(good_c_count_code_b64) == {{:ok, good_c_count_code}, ""}
    assert CodeTable.KeriCodeTableV1.get_B(good_c_count_code_b) == {:error, "This count code can't support binary elements"}
  end

