  test "Version switching works" do
    cesr_stream = "-_AAABAA" <> # keri/acdc protocol/genus 1
                  "-VAB" <> # attachment group (1 quadlet)
                    "1AAM" <> # True
                  "-_AAACAA" <> # keri/acdc protocol/genus 2
                  "-AAB" <> # Generic group (1 quadlet)
                    "1AAM" # True

    {:ok, random_attachment_group} = CountCodeKERIv1.CD_V_AttachmentGroup.new([Primitive.CD_1AAM_Yes.new(<<>>)])
    {:ok, random_generic_group} = CountCodeKERIv2.CD_A_GenericGroup.new([Primitive.CD_1AAM_Yes.new(<<>>)])

    expected_cesr_elements = [:keri_aaabaa, 
      random_attachment_group,
      :keri_aaacaa,
      random_generic_group
    ]
    assert Cesr.consume_stream(cesr_stream) == expected_cesr_elements
  end

  test "(vLEI CESR 1.0) Gleif Example streams parse" do
    # This test is to determine if all the example cesr streams from the
    # gleif ecosystem will parse correctly.
    #
    # They were taken from the wonderful cesr-decoder @
    # https://github.com/psteniusubi/cesr-decoder
    #
    # As of today 2025 vLEI still runs on CESR 1 so this is a test of
    # the current deployment
    #
    # We exclude the VCs because the sadpath was removed from GLEIF ACDCs
    # for some reason that nobody documented and the examples rely on
    # that code which is no longer in the version 1 codex on keripy
    
    for example_stream <- Path.wildcard("test/kerilixir/example_payloads/gleif_cesr_streams/*") |> 
                          Enum.filter(fn x -> not String.ends_with?(x, "-vc.cesr") end)
    do
      stream = File.read!(example_stream) 
      refute match?({:error, _}, Cesr.consume_stream(stream))
    end
  end

  def decode_python_16(python_hex_output) do
    Base.decode16!(String.replace(python_hex_output, "-", ""), case: :lower)
  end
